import React, { Fragment } from 'react';
import { Chart } from 'react-google-charts';
import axios from 'axios';

export default function Map() {
  const data = [['Countries', 'Total Confirmed']];

  React.useEffect(() => {
    async function dataCovid() {
      const resp = await axios.get(' https://api.covid19api.com/summary ');
      const countries = resp.data.Countries;
      // eslint-disable-next-line array-callback-return
      countries.map((obj) => {
        data.push([obj['Country'] ['TotalConfirmed']]);
      });
    }
    dataCovid();
  });

  return (
 <Fragment>
   < Chart
  width={'100%'}
  height={'300px'}
  chartType="GeoChart"
  data={data}

/>
  </Fragment>
  );
}
